function timeSince(date) {
    let seconds = Math.floor((new Date() - date) / 1000);
    let interval = 0;
    if (seconds > 0) {
        interval = Math.floor(seconds / 31536000);
        if (interval >= 1) {
            return interval + " " + Txt.Txt_Year_Ago;
        }
        interval = Math.floor(seconds / 2592000);
        if (interval >= 1) {
            return interval + " " + Txt.Txt_Month_Ago;
        }
        interval = Math.floor(seconds / 604800);
        if (interval >= 1) {
            return interval + " " + Txt.Txt_Week_Ago;
        }
        interval = Math.floor(seconds / 86400);
        if (interval >= 1) {
            return interval + " " + Txt.Txt_Day_Ago;
        }
        interval = Math.floor(seconds / 3600);
        if (interval >= 1) {
            return interval + " " + Txt.Txt_Hour_Ago;
        }
        interval = Math.floor(seconds / 60);
        if (interval > 1) {
            return interval + " " + Txt.Txt_Minutes_Ago;
        }
        return Txt.Txt_Just_Posted;
    }
    else {
        seconds = Math.abs(seconds);
        interval = Math.floor(seconds / 31536000);
        if (interval == 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Year_Left;
        }
        else if (interval > 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Years_Left;
        }
        interval = Math.floor(seconds / 2592000);
        if (interval == 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Month_Left;
        }
        else if (interval > 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Months_Left;
        }
        interval = Math.floor(seconds / 604800);
        if (interval == 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Week_Left;
        }
        else if (interval > 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Weeks_Left;
        }
        interval = Math.floor(seconds / 86400);
        if (interval == 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Day_Left;
        }
        else if (interval > 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Days_Left;
        }
        interval = Math.floor(seconds / 3600);
        if (interval == 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Hour_Left;
        }
        else if (interval > 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Hours_Left;
        }
        interval = Math.floor(seconds / 60);
        if (interval == 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Minute_Left;
        }
        else if (interval > 1) {
            return Txt.Txt_Prefix_Left + " " + interval + " " + Txt.Txt_Minutes_Left;
        }
        return "";
    }
}

