var preventDoubleFire = Date.now();
function checkIsDoubleEventFired(milliseconds) {
    try {
        if (milliseconds == null || milliseconds === undefined) {
            milliseconds = 200;
        }
        var millis = Date.now();
        if (millis - preventDoubleFire < milliseconds)
            return true;
        preventDoubleFire = millis;
    }
    catch (e) {
        console.log(e);
    }
    return false;
}
