var ComActionSupport = {

    getUVId: function () {
        if (jbkUser != null && jbkUser != undefined) {
            if (jbkUser.OType == 1) {
                return jbkUser.OId;
            }
        }
        return 0;
    },
    param: {
        JobId: 0,
        CsJob: "",
        Element: "",
        ChangeText:false,
    },
    resultText(ele, sts) {
        if (sts == true) {

            $(ele).addClass("active").addClass("disabled");
            if (ComActionSupport.param.ChangeText) {
                $("span", ele).text("Hủy thông báo việc làm");
            }

        } else {
            $(ele).removeClass("active").removeClass("disabled");
            if (ComActionSupport.param.ChangeText) {
                $("span", ele).text("Nhận thông báo việc làm");
            }

        }
    },
    sendHeart: function (ele, cid, cs) {
        try {

            var $this = $(ele);

            var isCheck = !$this.hasClass("active");
            var sts = isCheck ? 1 : 0;
            var comId = cid;
            var uvId = ComActionSupport.getUVId();
            var cs = cs;


            if (uvId != null && uvId != undefined && uvId > 0) {
                $.ajax({
                    url: "/ung-vien/quan-tam",
                    data: {
                        ty: 6,
                        id: comId,
                        cs: cs,
                        sts: sts
                    },
                    dataType: 'json',
                    success: function (response) {
                        switch (response.status) {
                            case "done":
                                ComActionSupport.resultText($this, sts == 1);
                                //$this.toggleClass("active");
                                break;
                            case "guest":
                                ComActionSupport.resultText($this, false);
                                //$this.removeClass("active");
                                msg_Confirm("Xác nhận", "Bạn cần đăng nhập để có thể tiếp tục", function (confirm) {
                                    if (confirm) {
                                        require_login(Txt.Txt_Require_Login, 0, function (isOK, data) {
                                            if (isOK) {
                                                //$("#uvid").val(data.uvid);
                                                $this.click();
                                            }
                                        });
                                    }
                                });
                                break;
                            default:
                                ComActionSupport.resultText($this, false);
                                //$this.removeClass("active");
                                msg_Info(response.message);
                                break;
                        }
                    },
                    error: function (error) {
                        ComActionSupport.resultText($this, false);
                        //$this.removeClass("active");
                        console.log("Quan Tâm ERROR");
                    }
                });
            }
            else {
                //$this.removeClass("active");
                ComActionSupport.resultText($this, false);
                msg_Confirm("Xác nhận", "Bạn cần đăng nhập để có thể tiếp tục", function (confirm) {
                    if (confirm) {
                        require_login(Txt.Txt_Require_Login, 0, function (isOK, data) {
                            if (isOK) {
                                //$("#uvid").val(data.uvid);
                                $this.click();
                            }
                        });
                    }
                });
            }
        }
        catch (ex) { }
    },
    checkHeart: function (isCheckHeight) {        
        if (isCheckHeight) {
            let wS = $(document).scrollTop(), wH = $(window).height();
            let hT = $(ComActionSupport.param.Element).offset().top;
            if (wS > (hT - wH - 300) && !$(ComActionSupport.param.Element).hasClass("loaded")) {
                var comsId = [];

                $(".item:not(.loaded)", ComActionSupport.param.Element).each(function (index, item) {
                    $(item).addClass("loaded");
                    comsId.push($(item).data("cid"))
                });

                var UvId = ComActionSupport.getUVId();
                this.getHeart(comsId, UvId);
            }
        } else {
            if ($(ComActionSupport.param.Element).length > 0 && $(".item:not(.loaded)", ComActionSupport.param.Element).length > 0) {

                var comsId = [];

                $(".item:not(.loaded)", ComActionSupport.param.Element).each(function (index, item) {
                    $(item).addClass("loaded");
                    comsId.push($(item).data("cid"))
                });

                var UvId = ComActionSupport.getUVId();
                this.getHeart(comsId, UvId);


            }
        }

    },
    getHeart: function (comsId, uvId) {
        try {

            $(ComActionSupport.param.Element).addClass("loaded");

            if (uvId != null && uvId != undefined && uvId > 0) {
                $.ajax({
                    url: "/ung-vien/kiem-tra-quan-tam-multiple",
                    data: {
                        ty: 6,
                        ids: comsId.join(),
                    },
                    dataType: 'json',
                    success: function (response) {
                        if (response.status) {

                            $.each(response.data, function (index, item) {
                                ComActionSupport.resultText($(".item[data-cid=" + item + "] .btnSaveCom", ComActionSupport.param.Element), true);

                                //$(".item[data-cid=" + item + "] .btnSaveCom", ComActionSupport.param.Element).addClass("active");

                            })
                            //$("#sendHeart").prop("checked", true);
                        }
                    },
                    error: function (error) {
                        console.log(error);
                        //$("#sendHeart").prop("checked", false);
                    }
                });
            }
        }
        catch (ex) {
            console.log(ex);
        }
    },
}

