var jbkSearchMajor = {
    init: function () {
        try {
            $(document).on("keyup", ".pn-nganh-hoc input[type=search]", function (e) {
                e.preventDefault();
                try {
                    if (event.key === "Enter") {
                        var txt = $(this).val();
                        if ($("select[name=NganhHoc] option[value='" + txt + "']").length <= 0 && $(".dropdown-item.active", ".pn-nganh-hoc").length <= 0) {
                            $("select[name=NganhHoc]").append("<option selected value='" + txt + "'>" + txt + "</option>");
                            $("select[name=NganhHoc]").selectpicker('refresh');
                            let text = $('select[name=NganhHoc]').val();
                            $('.pn-nganh-hoc  .filter-option-inner-inner').text(text);
                        }
                    }
                } catch (e) {
                }
            });

            $("#btnTimTheoKhoa").off("click").click(function () { jbkSearchMajor.search(); });
            $(".frmSearchMajor #txtTuKhoa").off("keydown").keydown(function (e) { if (13 == e.keyCode) jbkSearchMajor.search(); });

        } catch (e) {

        }
    },
    getSearchParams: function (e) {
        try {
            const formData = new FormData();
            let q = $(".frmSearchMajor #txtTuKhoa").length > 0 ? jbkSearch.normalizeText($(".frmSearchMajor #txtTuKhoa").val()) : "";
            let n = jbkSearch.normalizeText($(".frmSearchMajor [name='NganhHoc']").val());
            let l = $(".frmSearchMajor [name='TinhThanh']").val();            
            let jt = $(".frmSearchMajor input[name='LoaiHinh']:checked").val();

            if (q.length > 0)
                formData.append("q", q);
            if (n.length > 0)
                formData.append("n", n);
            if (l > 0)
                formData.append("l", l);            
            if (jt > 0)
                formData.append("jt", jt);
            
            return new URLSearchParams(formData);
        } catch (e) {
            return new URLSearchParams();
        }
    },
    search: function () {
        try {
            const searchParams = this.getSearchParams();
            if (searchParams.q != null && searchParams.q.length > 0) {
                searchParams.delete("n");
                let uri = new URL("/jobs", document.location);
                uri.search = searchParams.toString();
                window.location.href = uri.toString();
            }
            else {
                let uri = new URL("/viec-lam-theo-khoa", document.location);
                uri.search = searchParams.toString();
                window.location.href = uri.toString();
            }            
        }
        catch (e) {
            console.log(e)
        }
    },  
}
jbkSearchMajor.init();;
